import React, { Component } from 'react'

export default class Search extends Component {

    state = {
        contents: [],
        keyword: ""
    };

    handleInputChange = e => {
        this.setState({keyword: e.target.value});
    }

    render() {
        return (
            <div>
                <form>
                    <label>검색</label>
                    <input type="text"/>
                </form>
            </div>
        );
    }
}
